//topbar

import React, {Component} from 'react';

class topbar extends Component {
  render() {
    return (
      <div>
        <Navbar bg="light" expand="lg">
          <Navbar.Brand href = "#home">React-Bootstrap</Navbar.Brand>
        </Navbar>
      </div>
    )
  }
}

export default topbar;
